// src/components/Profile.js
const Profile = ({ user }) => {
    // If user is not available, show a loading message or redirect
    if (!user) {
      return <div>Loading...</div>; // You can replace this with a spinner or any loading state
    }
  
    return (
      <div>
        <h1>{user.name}'s Profile</h1>
        <p>Email: {user.email}</p>
        <p>Phone: {user.phone}</p>
        {/* Add more profile details as needed */}
      </div>
    );
  };
  
  export default Profile;
